const e=JSON.parse('{"key":"v-dd615446","path":"/zh/essay/sychronized.html","title":"sychronized","lang":"zh-CN","frontmatter":{"category":[],"tag":[],"title":"sychronized"},"headers":[],"git":{"createdTime":1684677761000,"updatedTime":1684677761000,"contributors":[{"name":"wangruifei","email":"670635964@qq.com","commits":1}]},"readingTime":{"minutes":1.93,"words":578},"filePathRelative":"zh/essay/sychronized.md","localizedDate":"2023年5月21日","excerpt":"<h4> 1</h4>\\n<ul>\\n<li>\\"synchronized\\" 一词来自希腊语，\\"syn\\" 意为 \\"together\\"，\\"chronos\\" 意为 \\"time\\"。因此，\\"synchronized\\" 字面意思是 \\"同时发生\\" 或 \\"同步\\"。在计算机科学领域，\\"synchronized\\" 通常指的是多个线程或进程之间的同步，即使它们在不同的时间片内运行，也能够协调它们的行为，从而避免产生冲突。</li>\\n</ul>\\n<h4> 2</h4>\\n<ul>\\n<li>简而言之，\\"synchronized\\" 这个词的翻译为 \\"同步\\" 是因为它描述的是多个线程或进程在时间上的协调。</li>\\n</ul>\\n"}');export{e as data};
